import Link from 'next/link'
import {withRouter} from 'next/router'

const A = ({router,name}) => (
<Link href="#aaa"><a>{router.query.id}{name}</a></Link>
)
A.getInitialProps = () => {
  console.log('---------------');
  return {
    name: 'wn'
  }
}

export default  withRouter(A)
